### YamlMime:QSharpType
uid: microsoft.quantum.math.iscoprimei
name: IsCoprimeI
type: function
namespace: Microsoft.Quantum.Math
summary: 如果 $a $ 和 $b $ 是共同质数，则返回 true; 否则返回 false。
syntax: 'function IsCoprimeI (a : Int, b : Int) : Bool'
input:
  content: '(a : Int, b : Int)'
  types:
  - name: a
    summary: 正在测试的 primality 的第一个数字
    isPrimitive: true
    uid: Int
  - name: b
    summary: 正在测试的 primality 的第二个数字
    isPrimitive: true
    uid: Int
output:
  content: Bool
  types:
  - summary: 如果 $a $ 和 $b $ 是共同质数（例如，其最大公因数为1），则为 True; 否则为 false。
    isPrimitive: true
    uid: Bool
